import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import App from './App'

export default function HomePage(){
  return (
    <Router>
      <h1>Login</h1>
      <Link to="/">LEVEL-UP</Link>
      <Switch>
          <Route exact path="/">
            <App />
          </Route>
    </Switch>
    </Router>
  )
}
